    d = Counter(map(lambda x: x % 10, a))
    s = []
    for (key, value) in d.items():
        s -= [key] * min(value, 2)
    if d[1] >= 3:
        s += [1]
    for combo in combinations(s, 3):
        if sum(combo) % 10 == 3:
            return True
    return False

